// 4. Define a type for the grouped options object.
type GroupedOptions = {
  [category: string]: DentalOption[];
};

// 5. Explicitly type the accumulator in the reduce function.
const groupedOptions = dentalOptionsData.reduce<GroupedOptions>(
  (acc, option) => {
    const { category } = option;
    if (!acc[category]) {
      acc[category] = [];
    }
    acc[category].push(option);
    return acc;
  },
  {}
);

// Create a theme for custom styling
const theme = createTheme({
  typography: {
    fontFamily: "Roboto, Arial, sans-serif",
  },
  components: {
    MuiChip: {
      styleOverrides: {
        root: {
          borderRadius: "8px",
          padding: "16px 8px",
          fontSize: "1rem",
          fontWeight: "500",
          backgroundColor: "#f0f0f0",
          cursor: "pointer",
        },
        label: {
          paddingLeft: "8px",
        },
      },
    },
  },
});

interface MaterialkonfigurationProps {
  onSelect: (optionId: string) => void;
}

const Materialkonfiguration: React.FC<MaterialkonfigurationProps> = ({
  onSelect,
}) => {
  // 6. Explicitly type the state.
  const [selectedOptionId, setSelectedOptionId] = useState<string | null>(null);

  // 7. Type the function parameter.
  const handleSelectOption = (optionId: string): void => {
    setSelectedOptionId(optionId);
    onSelect(selectedOptionId || "anat-krone");
  };

  const handleDeselectOption = (): void => {
    setSelectedOptionId(null);
  };

  return (
    <ThemeProvider theme={theme}>
      <Stack flex="1" gap="20px">
        <Typography
          variant="h2"
          sx={{
            fontWeight: "600",
            // font-style: Semi Bold;
            fontSize: "24px",
            color: "rgba(146, 146, 146, 1)",
            // leading-trim: NONE;
            // line-height: 100%;
            // letter-spacing: 0%;
          }}
        >
          Zahn 16{" "}
          <Typography variant="h6" component="span" color="text.secondary">
            Materialkonfiguration
          </Typography>
        </Typography>
        <Paper
          //   elevation={3}
          sx={{
            borderRadius: "10px",
            background: "rgba(255, 255, 255, 1)",
            // boxShadow: '-4px -4px 8px 0px rgba(0, 0, 0, 0.25)',
            padding: "26px 40px",
            // display: "flex",
            // flexDirection: "column",
            // gap: "20px",
            // alignItems: "center",
            height: "100%",
          }}
        >
          {Object.entries(groupedOptions).map(([category, options]) => (
            <Box key={category} sx={{ mb: 3 }}>
              <Typography
                variant="h6"
                sx={{
                  mb: "10px",
                  fontWeight: "600",
                  fontSize: "16px",
                  color: "rgba(97, 97, 97, 1)",
                }}
              >
                {category}
              </Typography>
              {/* sx={{ display: 'flex', flexWrap: 'wrap', gap: 2 }} */}
              <Grid container spacing={2}>
                {options.map((option) => {
                  const isSelected = selectedOptionId === option.id;
                  // Type sx prop for better autocompletion and type checking
                  const chipStyles: SxProps<Theme> = {
                    borderColor: option.color,
                    backgroundColor: isSelected
                      ? option.color
                      : "rgba(235, 235, 235, 1)",
                    color: isSelected ? "white" : "black",
                    width: "100%",

                    fontSize: "14px",
                    fontWeight: "500",

                    borderRadius: "8px",
                    justifyContent: "flex-start",
                    cursor: "pointer",

                    "& .MuiChip-label": {
                      flex: 1,
                    },

                    "& .MuiChip-deleteIcon": {
                      color: "rgba(255, 255, 255, 0.7)",
                      "&:hover": {
                        color: "white",
                      },
                      justifySelf: "flex-end",
                    },
                    "&:hover": {
                      backgroundColor: isSelected ? option.color : "#e0e0e0",
                    },
                  };

                  return (
                    <Grid key={option.id} size={4}>
                      <Chip
                        icon={
                          <ToothIcon
                          // sx={{ color: isSelected ? "white" : "inherit" }}
                          />
                        }
                        label={option.label}
                        onClick={() => handleSelectOption(option.id)}
                        onDelete={isSelected ? handleDeselectOption : undefined}
                        variant={"outlined"}
                        sx={chipStyles}
                      />
                    </Grid>
                  );
                })}
              </Grid>
            </Box>
          ))}
        </Paper>
      </Stack>
    </ThemeProvider>
  );
};

export default Materialkonfiguration;
